import axios from "axios";

const USER_API_BASE_URL = "http://localhost:8081/v1/users";

class UserService{

    getEmployees(){
        return axios.get(USER_API_BASE_URL);
    }

    createUser(user){
        return axios.post(USER_API_BASE_URL, user);
    }
}

export default new UserService()
